import React from "react";
import "../styles/Testimonial.css";

const Testimonial = () => {
  return (
    <div className="testimonial-container">
      <div className="testimonial">
        <div className="testimonial-card">
          <div>
            <img src={require("../asset/logo_green.svg")}></img>
            <p className="testimonial-body">
              We believe responsible and chemial free farming is the essential
              step to a sustainable future. In Urban Plantery, we vowed to
              foster our plants without any artifical chemial and to provide our
              customer to the utmost organic botanical wonder.
            </p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Testimonial;
